+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="E337D4364AFB29E494DC0EBDF1789D71", NativeString="Stay up to date with this creator!", LocalizedStrings=(("en","Stay updated!")))
+TextReplacements=(Category=Game, Namespace="", Key="5E6FCD6849D906E30D2BB3B8D0DD60CA", NativeString="Turn on notifications to get notified when creators publish or update islands.", LocalizedStrings=(("ar","تلقَ إشعارات داخل اللعبة عندما ينشر المبدعون الذين تتابعهم جزرًا جديدة."),("en","Get in-game notifications when creators you follow release new islands."),("de","Erhalte Benachrichtigungen im Spiel, wenn Creators, denen du folgst, neue Inseln veröffentlichen."),("es","Recibe notificaciones en el juego cuando los creadores que sigues publiquen nuevas islas."),("es-419","Recibe notificaciones en el juego cuando publiquen islas nuevas los creadores a los que sigues."),("fr","Recevez des notifications en jeu lorsque les créateurs que vous suivez publient de nouvelles îles."),("id","Dapatkan notifikasi dalam game ketika kreator yang kamu ikuti merilis pulau baru."),("it","Ricevi notifiche nel gioco quando i creatori che segui pubblicano nuove isole."),("ja","フォロー中のクリエイターが新しい島を公開したときに、ゲーム内通知を受け取ろう。"),("ko","팔로우하는 크리에이터가 신규 섬을 출시하면 게임 내 알림을 받으세요."),("pl","Otrzymuj powiadomienia w grze, gdy twórcy, których obserwujesz, opublikują nową wyspę."),("pt-BR","Receba notificações no jogo quando as pessoas criadoras que você segue lançarem novas ilhas."),("ru","Получайте внутриигровые уведомления, если авторы в подписках выпускают новые острова."),("th","รับการแจ้งเตือนในเกมเมื่อครีเอเตอร์ที่คุณติดตามปล่อยเกาะใหม่!"),("tr","Takip ettiğin içerik üreticileri yeni bir ada yayınladığında oyun içi bildirimler al."),("vi","Nhận thông báo trong trò chơi khi người sáng tạo mà bạn theo dõi ra mắt đảo mới."),("zh-hans","你关注的创作者发布新岛屿时，获取游戏内通知。"),("zh-Hant","在你追蹤的創作者推出新島嶼時，收到遊戲內通知。")))
+TextReplacements=(Category=Game, Namespace="", Key="4E1577CF49690C2CBB58C2BC338DAAE5", NativeString="Includes customizable decals! Decals in this bundle are restricted to the TBD car body. This car will fill the Sports Car slot in relevant Fortnite experiences.", LocalizedStrings=(("ar","تتضمن ملصقات قابلة للتخصيص! تقتصر ملصقات هذه الحزمة على هيكل سيارة Ferrari F40. ستملأ هذه السيارة خانة السيارة الرياضية في تجارب Fortnite ذات الصلة."),("en","Includes customizable decals! Decals in this bundle are restricted to the Ferrari F40 car body. This car will fill the Sports Car slot in relevant Fortnite experiences."),("de","Enthält anpassbare Aufkleber! Die Aufkleber in diesem Paket sind auf die Karosserie „Ferrari F40“ beschränkt. Dieses Auto belegt in relevanten Fortnite-Erlebnissen den Sportwagen-Slot."),("es","¡Incluye calcomanías personalizables! Las calcomanías de este lote solo están disponibles para la carrocería del Ferrari F40. Este vehículo ocupará el espacio del coche deportivo en las experiencias de Fortnite pertinentes."),("es-419","¡Incluye calcomanías personalizables! Las calcomanías de este lote solo están disponibles para la carrocería Ferrari F40. Este auto llenará el espacio de auto deportivo en las experiencias de Fortnite pertinentes."),("fr","Comprend des stickers personnalisables ! Les stickers de ce pack ne fonctionnent que sur le châssis de la Ferrari F40. Cette voiture sera placée dans l'emplacement Voiture de sport des expériences de Fortnite concernées."),("id","Termasuk stiker yang bisa dikustom! Stiker dalam bundel ini terbatas untuk bodi mobil Ferrari F40. Mobil ini akan mengisi slot Mobil Sport dalam pengalaman bermain Fortnite terkait."),("it","Include adesivi personalizzabili! Gli adesivi di questo bundle sono limitati alla carrozzeria Ferrari F40. Questa auto occuperà lo slot Auto sportiva nelle esperienze di Fortnite del caso."),("ja","カスタマイズ可能なデカールが付属！ このバンドル内のデカールは、マシンのボディ「Ferrari F40」に限定されています。 このマシンは、対応しているフォートナイトの体験においてスポーツカーとして使用できます。"),("ko","커스터마이징 가능한 데칼 포함! 이 번들의 데칼은 Ferrari F40 차체에만 사용할 수 있습니다. 이 차량은 관련 포트나이트 경험에서 스포츠카 슬롯에 할당됩니다."),("pl","Zawiera konfigurowalne wzory! Wzory z tego zestawu można wykorzystać tylko w połączeniu z karoserią Ferrari F40. Ten samochód znajdzie się w polu samochodu sportowego we wszystkich odpowiednich przygodach Fortnite."),("pt-BR","Inclui adesivos personalizáveis! Os Adesivos deste pacote são restritos ao Chassi Ferrari F40. Este carro preencherá o espaço de Carro Esportivo nas experiências Fortnite relevantes."),("ru","Включает настраиваемые декали! Декали из этого комплекта совместимы только с кузовом Ferrari F40. Этот автомобиль будет занимать ячейку спортивных автомобилей в соответствующих режимах Fortnite."),("th","มาพร้อมกับลายแต่งคัสตอม! ลายแต่งในบันเดิลนี้จะใช้ได้เฉพาะกับตัวรถ Ferrari F40 เท่านั้น รถคันนี้จะถูกเพิ่มลงในช่องรถสปอร์ตในประสบการณ์ Fortnite ที่เกี่ยวข้อง"),("tr","Özelleştirilebilir çıkartmalar içerir! Bu paketteki çıkartmaları yalnızca Ferrari F40 araba gövdesiyle kullanabilirsin. Bu araba uygun Fortnite deneyimlerinde spor araba yuvasını doldurur."),("vi","Bao gồm hình dán tùy chỉnh! Hình dán trong bộ quà này chỉ dành riêng cho thân xe Ferrari F40. Mẫu xe này sẽ được đưa vào ô Xe Thể Thao trong các chế độ chơi Fortnite liên quan."),("zh-hans","包括可定制的涂装！该同捆包中的涂装仅可用于Ferrari F40车体。在Fortnite相关体验中，该车会出现在运动跑车栏位中。"),("zh-Hant","當中包含可自訂貼花！此組合包的貼花僅限 Ferrari F40 車身使用。此車輛會在相關 Fortnite 體驗填入跑車欄位。")))
