+TextReplacements=(Category=Game, Namespace="", Key="C6799D1346C01440519409A4D3C8E8D2", NativeString="[PH] Hotfix Here", LocalizedStrings=(("ar","زي يوكي يوباري من نصيبك. حان الوقت لتُرسِّخ اسمك في عقول الناس."),("en","The Yuki Yubari Outfit is yours. Time to make them remember your name."),("de","Das Outfit Yuki Yubari gehört nun dir. Jetzt sorge dafür, dass sie deinen Namen nicht vergessen."),("es","El traje de Yuki Yubari es todo tuyo. Es hora de demostrarles quién eres."),("es-419","El atuendo Yuki Yubari es tuyo. Es hora de hacer que recuerden tu nombre."),("fr","La tenue Yuki Yubari est à vous. Il est grand temps de leur rappeler votre nom."),("id","Kostum Yuki Yubari jadi milikmu. Saatnya untuk memastikan mereka mengingat namamu."),("it","Il costume Yuki Yubari è tuo. È giunto il momento che tutti ricordino il tuo nome."),("ja","コスチューム「ユキ夕張」は君のものだ。敵にその名を刻んでやろう。"),("ko","유키 유바리 의상을 손에 넣으세요. 여러분의 이름을 기억하게 만들어줄 시간입니다."),("pl","Strój Yuki Yubari należy do ciebie. Czas, by zapamiętali twoje imię."),("pt-BR","O Traje Yuki Yubari é seu. Hora de fazer todo mundo lembrar do seu nome."),("ru","Экипировка Юки Юбари теперь ваша. Пусть они запомнят ваше имя."),("th","เครื่องแต่งกายยูกิ ยูบาริเป็นของคุณแล้ว ถึงเวลาทำให้ชื่อของคุณเป็นที่จดจำ"),("tr","Yuki Yubari kıyafeti seni bekliyor. Herkese kim olduğunu hatırlatma zamanı geldi."),("vi","Trang Phục Yuki Yubari đã thuộc về bạn. Đã tới lúc để bạn lưu danh vào tâm trí kẻ địch rồi."),("zh-hans","夕张雪姬皮肤是你的了。该让他们记住你的名字了。"),("zh-Hant","夕張雪造型到手。是時候讓他們記住你的名字了。")))
