+TextReplacements=(Category=Game, Namespace="", Key="69D79D0E4B1FA0828DE86BAE35B73534", NativeString="We'll check recent reportable messages for any Community Rules violations.\r\n\r\nWe won't tell anyone that you reported the channel. If action is taken against a member, your identity will remain private.", LocalizedStrings=(("ar","سيرسل بلاغك الرسائل الأخيرة التي يمكن الإبلاغ عنها من دردشتك إلى Epic Games للمراجعة.\n\nفور تقديمك للبلاغ، ستراجع Epic سلوك جميع المشاركين في محادثة الدردشة النصية، بما في ذلك سلوكك، للكشف عن أي انتهاكات لقواعد مجتمعنا. لن يتلقى اللاعبون إشعارات بأنك المبلّغ."),("en","Your report will submit recent reportable messages from your chat to Epic Games for review.\n\nOnce submitted, Epic will review the conduct of all participants in the text chat conversation, including yours, for any violations of our Community Rules. Players will not be notified that you are the reporter."),("de","Mit deiner Meldung werden kürzliche Nachrichten aus deinem Chat, die gemeldet werden können, an Epic Games zur Überprüfung übermittelt.\n\nNach Absenden der Meldung wird Epic das Verhalten aller Text-Chat-Gesprächsteilnehmer (inklusive dir) auf Verstöße gegen unsere Community-Regeln überprüfen. Die Spieler werden nicht darüber informiert, dass du es bist, der sie gemeldet hat."),("es","Tu informe compartirá los mensajes recientes de tu chat con Epic Games para que se revisen.\n\nUna vez enviado, Epic analizará la conducta de todos los participantes dentro de la conversación del chat de texto, incluyendo la tuya, para ver si se incumple alguna regla de la comunidad. No se notificará a los otros jugadores que has enviado un informe."),("es-419","Tu denuncia enviará los mensajes denunciables recientes de tu chat a Epic Games para su revisión.\n\nUna vez enviada, Epic revisará la conducta de todos los participantes de la conversación del chat de texto, incluida la tuya, en busca de infracciones del reglamento de la comunidad. Los jugadores no recibirán ninguna notificación que indique que tú hiciste la denuncia."),("fr","Votre signalement transmettra à Epic Games les messages textuels récents pertinents pour examen.\n\nUne fois le signalement envoyé, Epic examinera le comportement de tous les participants à la discussion textuelle, y compris le vôtre, pour déterminer s'il y a eu une infraction aux Règles de la communauté. Les joueurs ne sauront pas que vous êtes à l'origine du signalement."),("id","Laporanmu akan mengirim pesan terkini yang bisa dilaporkan dari obrolanmu ke Epic Games untuk ditinjau.\n\nSetelah dikirim, Epic akan meninjau perilaku semua peserta dalam obrolan teks, termasuk kamu, untuk setiap pelanggaran terhadap Peraturan Komunitas kami. Pemain tidak akan tahu bahwa kamu yang melaporkan."),("it","La tua segnalazione invierà i messaggi segnalabili recenti dalla chat a Epic Games per farli esaminare.\n\nUna volta inviata la segnalazione, Epic valuterà la condotta di tutti i partecipanti alla conversazione nella chat testuale, compresa la tua, verificando se vi sono violazioni delle regole della community. I giocatori non verranno avvisati del fatto che la segnalazione è tua."),("ja","あなたの通報により、チャット内の最近の通報可能なメッセージを対象にEpic Gamesが審査を行います。\n\n送信後、Epicはあなたも含め、その会話の参加者全員の発言を検証し、コミュニティ規定の違反がないか審査します。あなたが通報者であるということは、相手には通知されません。"),("ko","신고하면 채팅에서 신고 가능한 최근 메시지를 에픽게임즈에 제출하여 검토를 받습니다.\n\n에픽은 신고가 들어오면 신고자를 비롯해 텍스트 채팅 대화에 참여한 전원의 행동을 검토하여 커뮤니티 규정 위반 사실이 있는지 확인합니다. 신고 대상에게는 신고자가 누구인지 알림이 가지 않습니다."),("pl","Zgłoszenie, które wysyłasz do Epic Games, będzie zawierać ostatnie zarejestrowane wiadomości z czatu.\n\nPo otrzymaniu zgłoszenia Epic sprawdzi zachowanie wszystkich uczestników czatu, w tym twoje, pod kątem naruszenia zasad społeczności.  Gracze nie będą informowani, że ich zgłaszasz."),("pt-BR","Seu relatório enviará as mensagens recentes no seu bate-papo para análise da Epic Games.\n\nApós o envio, a Epic analisará a conduta de todo mundo que participa do bate-papo de texto, incluindo a sua, para verificar possíveis violações das nossas Regras da Comunidade. As outras pessoas jogadoras não serão notificadas que você enviou a denúncia."),("ru","Если вы пожалуетесь, недавние сообщения из вашего чата будут отправлены на проверку в Epic Games.\n\nПолучив жалобу, Epic оценит поведение всех участников разговора в текстовом чате, включая вас, на предмет нарушения Правил сообщества. Игроки не узнают, что жалобу отправили вы."),("th","การรายงานของคุณจะส่งข้อความที่รายงานได้ล่าสุดจากการแชทของคุณให้กับ Epic Games เพื่อตรวจสอบ\n\nเมื่อ ส่งแล้ว Epic จะตรวจสอบผู้เข้าร่วมทุกคนในการสนทนาแชทข้อความเพื่อตรวจหาการละเมิดกฎชุมชนใดๆ ของเรา รวมถึงแชทการสนทนาของคุณด้วย ระบบจะไม่แจ้งให้ผู้เล่นดังกล่าวทราบว่าคุณเป็นผู้รายงาน"),("tr","Raporun, raporlanabilecek son mesajları değerlendirme amacıyla Epic Games'e gönderecek.\n\nGönderim tamamlandıktan sonra Epic, sen de dahil olmak üzere yazılı sohbetteki tüm katılımcıların davranışlarını inceler ve Topluluk Kuralları ihlallerini bulmaya çalışır. Oyuncular, kendilerini raporlayan kişinin sen olduğunu öğrenemez."),("vi","Báo cáo của bạn sẽ gửi các tin nhắn cần báo cáo từ cuộc trò chuyện của bạn để Epic Games xem xét.\n\nNgay sau khi bạn gửi, Epic sẽ xem xét hành vi của tất cả người tham gia trong cuộc chat văn bản, bao gồm cả bạn, để kiểm tra khả năng vi phạm Quy Tắc Cộng Đồng của chúng tôi. Người chơi sẽ không nhận được thông báo rằng bạn là người báo cáo."),("zh-hans","举报后，你的聊天中近期可举报的消息将提交给Epic Games审核。\n\n举报提交后，Epic将审查包括你在内的所有文字聊天参与者的行为，以判断其是否违反《社区规定》。玩家被举报时不会收到通知，也不会知道举报人是谁。"),("zh-Hant","你的檢舉會將近期可檢舉的聊天訊息提交給 Epic Games 審查。\n\n送出之後，Epic 會審查文字聊天對話中所有參與人（包括你自己）的行為，確認是否違反社群規則。玩家不會知道你是檢舉者。")))
