+TextReplacements=(Category=Game, Namespace="", Key="D0FD26B34D6941A3A69766BF2E8D7EB0", NativeString="Ninjago Island is <emphasis>dangerous</>, survival depends on <emphasis>equipping high</> <img id=\"Tier\"/> <emphasis>Ninja gear!</>", LocalizedStrings=(("ar","إن Ninjago جزيرة <emphasis>خطيرة</> ويعتمد الصمود على <emphasis>التجهز <img id=\"بدرجة\"/> عالية</> <emphasis>من عتاد النينجا!</>"),("en","Ninjago Island is <emphasis>dangerous</>, survival depends on <emphasis>equipping high</> <img id=\"Tier\"/> <emphasis>Ninja gear!</>"),("de","Die Ninjago-Insel ist <emphasis>gefährlich</>, zum Überleben benötigst du <emphasis>gute</> <img id=\"Tier\"/> <emphasis>Ninja-Ausrüstung!</>"),("es","La isla de Ninjago es <emphasis>peligrosa</>, <emphasis>¡ponte</> <emphasis>equipamiento ninja de nivel</> <img id=\"superior\"/> <emphasis>!</>."),("es-419","La Isla Ninjago es <emphasis>peligrosa</>, ¡tu supervivencia depende de <emphasis>un buen</> <img id=\"Tier\"/> <emphasis>equipamiento ninja!</>"),("fr","Le <emphasis>danger</> règne sur l'île de Ninjago. Pour survivre, il vous faudra de l'<emphasis>équipement ninja</> <emphasis>de haut palier</> <img id=\"Tier\"/> !"),("id","Pulau Ninjago itu <emphasis>berbahaya</>, kemampuan bertahan hidup bergantung pada <emphasis>penggunaan perlengkapan Ninja</> <img id=\"Tier\"/> <emphasis>tingkat tinggi!</>"),("it","L'isola di Ninjago è <emphasis>pericolosa</>, dovrai fare affidamento su un <emphasis>equipaggiamento ninja di alto livello</> <img id=\"Tier\"/> per sopravvivere!"),("ja","ニンジャゴーの島は<emphasis>危険</>だよ。生き残るには、<emphasis>強い</> <img id=\"Tier\"/> <emphasis>ニンジャ装備</>を装備することが重要なんだ。"),("ko","닌자고 섬은 <emphasis>위험</>합니다. 생존은 <emphasis>높은</> <img id=\"Tier\"/> <emphasis>닌자 장비 착용</>에 달려 있습니다!"),("pl","Wyspa Ninjago jest <emphasis>niebezpieczna</> – tylko <emphasis> sprzęt ninjów</> <emphasis>wysokiego poziomu</> <img id=\"Tier\"/> gwarantuje przetrwanie!"),("pt-BR","A Ilha Ninjago é <emphasis>perigosa</>. A sobrevivência depende de <emphasis>equipamento Ninja de alta qualidade</> <img id=\"Tier\"/>!"),("ru","Остров Ninjago <emphasis>опасен</>, выживание зависит от <emphasis>использования высококачественного</> <img id=\"Tier\"/> <emphasis>снаряжения ниндзя!</>"),("th","เกาะนินจาโกนั้น <emphasis>อันตราย</> การเอาชีวิตรอดขึ้นอยู่กับ <emphasis>การสวมใส่อุปกรณ์ระดับสูง</> <img id=\"Tier\"/> <emphasis>ชุดนินจา!</>"),("tr","Ninjago Adası <emphasis>tehlikeli</> bir ada, hayatta kalmak için <emphasis>yüksek</> <img id=\"Tier\"/> <emphasis>ninja teçhizatlarını kuşan!</>"),("vi","Đảo Ninjago là một nơi <emphasis>nguy hiểm</> và sự sống còn phụ thuộc vào việc <emphasis>sử dụng</> <emphasis>trang bị Ninja cấp cao <img id=\"Tier\"/>!</>"),("zh-hans","幻影忍者岛<emphasis>极度危险</>，若想生存，必须<emphasis>装备高阶</><img id=\"Tier\"/><emphasis>忍者装备！</>"),("zh-Hant","旋風忍者島是<emphasis>危險之地</>，生存取決於<emphasis>是否配備頂級</> <img id=\"Tier\"/> <emphasis>忍者裝備！</>")))
+TextReplacements=(Category=Game, Namespace="", Key="13F06CA247CD7E53A7B21882DFBBE755", NativeString="Ninjago Island is <emphasis>dangerous</>, survival depends on <emphasis>equipping high</> <img id=\"Tier\"/> <emphasis>Ninja gear!</>", LocalizedStrings=(("ar","جزيرة Ninjago <b>أخطر</> من أي مكان زرته من قبل، ستكون في ورطة بدون<emphasis>التجهز <img id=\"بدرجة\"/> عالية</> <emphasis>من عتاد النينجا</>. ورطة كبيرة جدًا!"),("en","Ninjago Island is <emphasis>dangerous</>, survival depends on <emphasis>equipping high</> <img id=\"Tier\"/> <emphasis>Ninja gear!</>"),("de","Die Ninjago-Insel ist <b>gefährlicher</> als jeder Ort, an dem du bisher gewesen bist. Ohne <emphasis>gute</> <img id=\"Tier\"/> <emphasis>Ninja-Ausrüstung</> verbrennst du dir die Finger. Und zwar extra knusprig!"),("es","La isla de Ninjago es <b>más peligrosa</> que cualquier otro lugar en el que has estado. Estás acabado sin <equipamiento ninja</> <emphasis>de nivel</> <img id=\"superior\"/>. ¡Bien acabado!"),("es-419","La Isla Ninjago es el lugar <b>más peligroso</> de todos, estás frito sin <emphasis>un buen</> <img id=\"Tier\"/> <emphasis>equipamiento ninja</>. ¡Bien frito!"),("fr","L'île Ninjago est <b>plus dangereuse</> que tout ce que avez connu jusqu'à présent. Sans <emphasis>équipement ninja</> <emphasis>de haut palier</> <img id=\"Tier\"/>, vous ne survivrez pas longtemps ! Vraiment pas longtemps !"),("id","Pulau Ninjago itu jauh <b>lebih berbahaya</> dibanding tempat apa pun, dan kamu pasti tamat tanpa <emphasis>perlengkapan Ninja</> <img id=\"Tier\"/> <emphasis>tingkat tinggi</>. Bukan sekadar tamat, benar-benar hancur lebur!"),("it","L'isola di Ninjago è <emphasis>molto più pericolosa</> di qualsiasi altro posto al mondo. Sei alla frutta senza un <emphasis>equipaggiamento ninja di alto livello</> <img id=\"Tier\"/>. Alla frutta con panna!"),("ja","ニンジャゴーの島はこれまで訪れたどの場所よりも<b>危険</>だね。<emphasis>強い</> <img id=\"Tier\"/> <emphasis>ニンジャ装備</>がないとすぐにやられちゃうよ。すぐにね！"),("ko","닌자고 섬은 이전에 가본 어떤 곳보다 <b>더 위험</>합니다. <emphasis>높은</> <img id=\"Tier\"/> <emphasis>닌자 장비</>가 없다면 끝장입니다. 완전하게 끝장이요!"),("pl","Wyspa Ninjago jest <emphasis>znacznie groźniejsza</>, niż inne odwiedzone przez ciebie miejsca. Bez <emphasis>sprzętu ninjów</> <emphasis>wysokiego poziomu</> <img id=\"Tier\"/> daleko nie zawędrujesz! Wierz mi na słowo!"),("pt-BR","A Ilha Ninjago é <b>o lugar mais perigoso</> em que você já esteve. Você vai fritar sem um equipamento ninja <emphasis>de alta qualidade</> <img id=\"Tier\"/>. Será chocante..."),("ru","Остров Ninjago <b>опаснее</> любого места, где вы бывали раньше, — без <emphasis>высококлассного</> <img id=\"Tier\"/> <emphasis>снаряжения ниндзя</> вам конец. Печальный конец!"),("th","เกาะนินจาโกนั้น <b>อันตรายกว่า</> ที่ไหนๆ ที่คุณเคยไปมาก่อน คุณจะแย่แน่ๆ ถ้าปราศจาก <emphasis>อุปกรณ์ระดับสูง</> <img id=\"Tier\"/> <emphasis>ชุดนินจา</> ไหม้เกรียมเป็นขี้เถ้าเลย!"),("tr","Ninjago Adası diğer yerlerden <b>daha tehlikelidir</>, <emphasis>yüksek</> <img id=\"Tier\"/> <emphasis>ninja teçhizatın</> yoksa seni çıtır çıtır yerler. Çıtır çıtır!"),("vi","Đảo Ninjago <b>nguy hiểm hơn</> bất cứ nơi nào bạn từng đặt chân đến trước đây và bạn sẽ bị làm gỏi nếu không <emphasis>sử dụng</> <emphasis>trang bị Ninja cấp cao <img id=\"Tier\"/></>. Làm gỏi chín món luôn đấy!"),("zh-hans","幻影忍者岛比你之前去过的任何地方都<b>更加危险</>， 没有<emphasis>高阶</> <img id=\"Tier\"/> <emphasis>忍者装备</>，你将寸步难行。一步都别想迈出去！"),("zh-Hant","旋風忍者島比你去過的任何地方還<b>更加危險</>，要是沒有<emphasis>頂級</> <img id=\"Tier\"/> <emphasis>忍者裝備</>你就完蛋了。 徹底完蛋！")))
+TextReplacements=(Category=Game, Namespace="", Key="A36C3E1D401268C9026BCDBCF31C51A7", NativeString="Equip the <emphA>Spinjitzu Scroll</> in your <img id=\"Inventory\"/> <emphA>Inventory</>", LocalizedStrings=(("ar","قم بتجهيز <emphA>مخطوطة سبينجيتسو</> في <img id=\"Inventory\"/> <emphA>مخزونك</> مع <keybind>JunoOpenMenu</>"),("en","Equip the <emphA>Spinjitzu Scroll</> in your <img id=\"Inventory\"/> <emphA>Inventory</> with <keybind>JunoOpenMenu</>"),("de","Rüste die <emphA>Spinjitzu-Schriftrolle</> in deinem <img id=\"Inventory\"/> <emphA>Inventar</> mit <keybind>JunoOpenMenu</> aus"),("es","Equipa el <emphA>pergamino del Spinjitzu</> en tu <img id=\"Inventory\"/> <emphA>inventario</> con <keybind>JunoOpenMenu</>"),("es-419","Equipa el <emphA>pergamino de Spinjitzu</> en el <img id=\"Inventory\"/> <emphA>inventario</> con <keybind>JunoOpenMenu</>"),("fr","S'équiper du <emphA>parchemin du Spinjitzu</> dans votre <img id=\"Inventory\"/> <emphA>inventaire</> avec <keybind>JunoOpenMenu</>"),("id","Pasang <emphA>Gulungan Spinjitzu</> di <img id=\"Inventory\"/> <emphA>Inventaris</> melalui <keybind>JunoOpenMenu</>"),("it","Equipaggia la <emphA>pergamena dello Spinjitzu</> nel tuo <img id=\"Inventory\"/> <emphA>inventario</> con <keybind>JunoOpenMenu</>"),("ja","<keybind>JunoOpenMenu</>で<img id=\"Inventory\"/><emphA>インベントリ</>を開き、<emphA>スピン術の巻物</>を装備しよう"),("ko","<keybind>JunoOpenMenu</>를 눌러 <img id=\"Inventory\"/> <emphA>인벤토리</>에서 <emphA>스핀짓주 두루마리</> 장착"),("pl","Wyposaż <emphA>zwój Spinjitzu</> w <img id=\"Inventory\"/> <emphA>ekwipunku</> przy pomocy <keybind>JunoOpenMenu</>"),("pt-BR","Equipe o <emphA>Pergaminho de Spinjitzu</> no seu <img id=\"Inventory\"/> <emphA>Inventário</> com <keybind>JunoOpenMenu</>"),("ru","Нажмите <keybind>JunoOpenMenu</> и выберите <emphA>свиток кружитцу</> в <img id=\"Inventory\"/> <emphA>инвентаре</>"),("th","สวมใส่<emphA>คัมภีร์สปินจิตสึ</>ใน <img id=\"Inventory\"/> <emphA>ช่องเก็บของ</>ของคุณด้วย <keybind>JunoOpenMenu</>"),("tr","<keybin