+TextReplacements=(Category=Game, Namespace="", Key="BFA748DA4181CB6EAA1BA180A978F549", NativeString="Straight from the animation desk at Studio Pierrot.", LocalizedStrings=(("ar","من استوديو الرسوم المتحركة في \"بيرو فيلمز\". أعمال فنية من افتتاحية الجزئين 1 و3."),("en","Straight from the animation studio, PIERROT FILMS. Production arts from Part1 Opening and #3."),("de","Direkt vom Animationsstudio PIERROT FILMS. Produktionszeichnungen aus dem Opening von Part 1 und Nr. 3."),("es","Directo desde el departamento de animación de PIERROT FILMS. Producción de arte de la intro de la parte 1 y n.º 3."),("es-419","Directo desde el departamento de animación de PIERROT FILMS. Arte de la producción del tercer opening de la primera temporada."),("fr","Provient directement du célèbre studio d'animation, PIERROT FILMS. Illustrations de production du générique et de l'épisode 3 de la partie 1."),("id","Langsung dari studio animasi, PIERROT FILMS. Seni produksi dari Intro Bagian 1 dan Episode 3."),("it","Direttamente dallo studio di animazione, PIERROT FILMS. Illustrazioni dell'intro della parte 1 e n. 3."),("ja","アニメーションスタジオ「PIERROT FILMS」から、TVアニメ『BLEACH 千年血戦篇』第1クールOPおよび第3話の原画をお届け。"),("ko","스튜디오 피에로 애니메이션 부서에서 직접 제작했습니다. 파트 1 오프닝과 3화 제작 아트입니다."),("pl","Od animatorów ze studia PIERROT FILMS. Grafiki z czołówki części 1 i sezonu 3."),("pt-BR","Direto do estúdio de animação PIERROT FILMS.  Artes de produção da Abertura da Parte 1, e nº 3."),("ru","Материалы от анимационной студии PIERROT FILMS. Эскизы для опенингов первой и третьей частей."),("th","ส่งตรงจากสตูดิโอผู้สร้างแอนิเมชัน PIERROT FILMS งานภาพเบื้องหลังการผลิตจากฉากเปิด 1 และตอนที่ 3"),("tr","PIERROT FILMS animasyon stüdyosundan kopup geldi. Part1 Açılış ve #3'ten prodüksiyon çizimleri."),("vi","Tác phẩm gốc từ chính studio hoạt hình PIERROT FILMS. Tranh phác thảo Đoạn Mở Đầu Phần 1 và 3."),("zh-hans","从PIERROT FILMS动画工作室直出。出自第1部分片头和第3话的官方插图。"),("zh-Hant","來自動畫製作公司 PIERROT FILMS 的原版製作美術稿。收錄自第 1 部片頭與第 3 話。")))
