+TextReplacements=(Category=Game, Namespace="", Key="6B1131F1475F5E55F37AB181D6F86CA7", NativeString="Includes customizable decal! Decals in this bundle are restricted to the Back To The Future Time Machine car body. This car will fill the Sportscar slot in relevant Fortnite experiences.", LocalizedStrings=(("ar","تتضمن ملصق تدفّق الزمن الكرتوني الذي يتفاعل مع السرعة! ملصقات هذه الحزمة مقتصرة على هيكل سيارة آلة زمن العودة إلى المستقبل. ستملأ هذه السيارة خانة السيارة الرياضية في تجارب Fortnite ذات الصلة."),("en","Includes a speed-reactive animated Decal, Time Stream! Decals in this bundle are restricted to the Back To The Future Time Machine car body. This car will fill the Sports Car slot in relevant Fortnite experiences."),("de","Enthält einen geschwindigkeitsreaktiven und animierten Aufkleber – Time Stream! Die Aufkleber in diesem Bundle sind auf die Karosserie „‚Zurück in die Zukunft‘-Zeitmaschine“ beschränkt. Dieses Auto belegt in relevanten Fortnite-Erlebnissen den Sportwagen-Slot."),("es","Incluye la calcomanía Desplazamiento temporal, que cambia según tu velocidad. Las calcomanías de este lote solo están disponibles para la carrocería de la Máquina del tiempo de Regreso al Futuro. Este vehículo ocupará el espacio del coche deportivo en las experiencias de Fortnite pertinentes."),("es-419","Incluye la calcomanía Desplazamiento temporal, ¡que cambia según la velocidad! Las calcomanías de este lote solo están disponibles para la carrocería Máquina del tiempo de Volver al futuro. Este auto llenará el espacio de auto deportivo en las experiencias de Fortnite pertinentes."),("fr","Comprend un sticker qui réagit à la vitesse : Flux temporel ! Les stickers de ce pack ne fonctionnent que sur le châssis de la machine à remonter le temps de Retour vers le futur. Cette voiture sera placée dans l'emplacement Voiture de sport des expériences de Fortnite concernées."),("id","Termasuk Aliran Waktu, Stiker yang  akan bereaksi seiring bertambahnya kecepatan mobil! Stiker dalam bundel ini terbatas untuk bodi mobil Mesin Waktu Back To The Future. Mobil ini akan mengisi slot Mobil Sport dalam pengalaman bermain Fortnite terkait."),("it","Include un adesivo animato reattivo alla velocità: Flusso temporale! Gli adesivi di questo bundle sono limitati alla carrozzeria Macchina del tempo di Ritorno al futuro. Questa auto occuperà lo slot Auto sportiva nelle esperienze di Fortnite del caso."),("ja","スピードに反応するアニメーション付きデカールが付属。タイムストリーム！ このバンドル内のデカールは、マシンのボディ「バック・トゥ・ザ・フューチャーのタイムマシン」に限定されています。このマシンは、対応しているフォートナイトの体験においてスポーツカーとして使用できます。"),("ko","속도 반응형 애니메이션 데칼 '시간의 흐름'을 포함합니다! 이 번들의 데칼은 '백 투 더 퓨처 타임머신' 차체에만 사용할 수 있습니다. 해당 차량은 관련 포트나이트 경험에서 스포츠카 슬롯에 할당됩니다."),("pl","Zawiera reagującą na prędkość, animowaną naklejkę Time Stream! Kalkomanie w tym zestawie są ograniczone do karoserii Wehikułu czasu z filmu „Powrót do przyszłości”. Ten samochód znajdzie się w polu samochodu sportowego we wszystkich odpowiednich przygodach Fortnite."),("pt-BR","Inclui um Adesivo animado e reativo à velocidade o Fluxo de Tempo! Os adesivos neste pacote são restritos ao chassi Máquina do Tempo De Volta para o Futuro. Este carro preencherá o espaço de Carro Esportivo nas experiências Fortnite relevantes."),("ru","Включает декаль, которая меняет внешний вид при ускорении! Декали из этого комплекта совместимы только с машиной времени из «Назад в будущее». Эта машина будет занимать ячейку спортивных автомобилей в соответствующих режимах Fortnite."),("th","รวมถึงลายแต่งเคลื่อนไหวที่ตอบสนองต่อความเร็ว ไทม์สตรีม! ลายแต่งในบันเดิลนี้ใช้ได้เฉพาะกับตัวถังรถ รถไทม์แมชชีนเจาะเวลาหาอดีต เท่านั้น รถคันนี้จะใส่ลงในช่องรถสปอร์ตในประสบการณ์ Fortnite ที่เกี่ยวข้อง"),("tr","Hıza göre değişen animasyonlu Zaman Akışı çıkartmasını içerir! Bu paketteki çıkartmaları yalnızca Geleceğe Dönüş Zaman Makinesi araba gövdesiyle kullanabilirsin. Bu araba uygun Fortnite deneyimlerinde spor araba yuvasını doldurur."),("vi","Bao gồm cả Hình Dán động Dòng Thời Gian phản ứng theo tốc độ xe! Hình dán trong bộ quà này dành riêng cho thân xe Máy Du Hành Thời Gian Trở Lại Tương Lai. Mẫu xe này sẽ được đưa vào ô Xe Thể Thao trong các chế độ chơi Fortnite liên quan."),("zh-hans","包含时间流涂装，该涂装的动画会随速度变化！此同捆包中的涂装仅可用于回到未来时光机车身。在Fortnite相关体验中，此车辆会出现在运动跑车栏位。"),("zh-Hant","包括一款速度感應式動態貼花「時光流影」！此組合包的貼花僅限《回到未來》時光機車身使用。此車輛會在相關 Fortnite 體驗填入跑車欄位。")))
