+TextReplacements=(Category=Game, Namespace="", Key="5137273644E5D131E1AB42AC14C6C1B0", NativeString="Damage opponents within 5 seconds after using or being under the effect of Invisible Splash", LocalizedStrings=(("ar","ألحق ضررًا بالخصوم خلال 5 ثوانٍ من استخدام سائل التخفّي أو تحت تأثيره"),("en","Damage opponents within 5 seconds after using or being under the effect of Stealth Splash"),("de","Füge Gegnern innerhalb von 5 Sekunden Schaden zu, nachdem der Effekt des Tarnpacks auf dich wirkt"),("es","Inflige daño a oponentes en un plazo de 5 segundos tras usar el salpicón de sigilo o estando bajo sus efectos"),("es-419","Inflige daño a oponentes en 5 segundos después de usar o de estar bajo el efecto de la invisibomba"),("fr","Infliger des dégâts à des adversaires dans les 5 s suivant l'utilisation de l'aspergeur de limon furtif ou pendant son effet"),("id","Timbulkan damage kepada lawan dalam 5 detik setelah menggunakan atau saat berada di dalam efek Cipratan Terselubung"),("it","Danneggia gli avversari entro 5 secondi dopo aver usato o essere sotto l'effetto dello Schizzo furtivo"),("ja","ステルス スプラッシュの使用後、またはその効果が発動している状態で5秒以内に敵にダメージを与える"),("ko","은신 스플래시를 사용하거나 효과가 적용된 후 5초 이내에 다른 플레이어에게 피해 주기"),("pl","Zadaj przeciwnikom obrażenia w ciągu 5 sekund po użyciu efektu Fontanny Niewidzialności lub pod jej wpływem"),("pt-BR","Cause dano a oponentes em até 5 s após usar ou estar sob efeito de Respingo Furtivo"),("ru","Нанесите противникам урон в течение 5 сек. после использования или получения эффекта от маскировочного всплеска"),("th","สร้างความเสียหายใส่คู่ต่อสู้ภายในเวลา 5 วินาทีหลังจากใช้หรืออยู่ภายใต้เอฟเฟกต์สเตลท์สแปลช"),("tr","Gizlilik Bombası kullandıktan veya etkisine girdikten sonra 5 saniye içinde rakiplere hasar ver"),("vi","Gây sát thương cho các đối thủ trong vòng 5 giây sau khi sử dụng hoặc chịu ảnh hưởng của Nước Bắn Vô Hình"),("zh-hans","在使用潜行溅射或受其影响的5秒内对对手造成伤害"),("zh-Hant","在使用或受到潛行飛濺效果後的 5 秒內對對手造成傷害")))
