+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="C440BB674FE10E5C10285F82F4EE36A4", NativeString="Altering the fibers of the Storm itself, you force it to come to you.", LocalizedStrings= (("ar","بتغيير نسيج الواقع ستجبر العاصفة على التحرّك ناحيتك. الاستخدام لمرة واحدة فقط - كن حريصًا!"),("en","Altering the fibers of reality, you command the Storm to come to you. It can only be used once - use wisely!"),("de","Indem du die Fasern der Realität veränderst, befiehlst du dem Sturm, zu dir zu kommen. Kann nur einmal verwendet werden – verwende ihn weise!"),("es","Alteras las fibras de la realidad y ordenas a la tormenta que se acerque hacia ti. Solo se puede usar una vez, así que ¡hazlo con cabeza!"),("es-419","Puedes alterar las fibras de la realidad para hacer que la tormenta venga hacia ti. Solo se puede usar una vez, así que ¡piénsalo bien!"),("fr","Modifiez la structure de la réalité et prenez le contrôle de la tempête en la faisant venir à vous. Cet objet est à usage unique : faites-en bon usage !"),("id","Dengan mengubah alur realitas, kamu memanggil Badai ke sisimu. Hanya bisa dipakai sekali - pakai dengan bijak!"),("it","Alterando le fibre della realtà, costringi la Tempesta ad avvicinarsi a te. Puoi farlo solo una volta, pensaci bene!"),("ja","現実を歪めて嵐を呼び寄せます。一度しか使えないので慎重に使いましょう。"),("ko","현실을 뒤틀어 폭풍을 곁으로 불러옵니다. 단 한 번만 사용할 수 있으니 신중하게 사용하세요."),("pl","Naginając strukturę rzeczywistości, rozkazujesz burzy, by do ciebie przyszła. Można go użyć tylko raz – korzystaj mądrze!"),("pt-BR","Você altera os fragmentos da realidade e comanda que a Tempestade venha até você. Só pode ser usado uma vez. Use com sabedoria!"),("ru","Меняя саму ткань мироздания, вы приказываете Буре явиться к вам. Используйте с умом — это можно сделать лишь раз!"),("th","ด้วยพลังเปลี่ยนแปลงความเป็นจริง คุณจึงสามารถสั่งให้พายุพัดมาหาคุณได้ ใช้ได้เพียงครั้งเดียวเท่านั้น โปรดใช้อย่างรอบคอบ!"),("tr","Gerçekliği bükerek fırtınaya sana doğru gelmesini emret. Yalnızca bir kez kullanılabilir. Akıllıca kullan!"),("vi","Thay đổi chính kết cấu của thực tại, bạn ra lệnh cho Cơn Bão tìm đến mình. Hãy cân nhắc thật kỹ vì bạn chỉ có thể sử dụng một lần mà thôi!"),("zh-hans","改变现实的结构，召唤风暴朝你而来。只能使用一次，谨慎使用！"),("zh-Hant","改變現實的結構，召喚風暴朝你而來。只能使用一次，要謹慎使用！")))
